  onClickHandler() {
    Auth.login();
  }

  render () {
    return (
      //AUTH WILL GO HERE
        <div className="container">
            This is the Login Page!<br /><br />

            <button onClick={this.onClickHandler}>Login</button><br /><br />
            <Link to="/create_account">Create Account</Link>
        </div>
    );
  }
};

export default Login;
